import React, {Component} from 'react';
import MakeRequest from './MakeRequest';
import DataCenter from './DataCenter';
import Cloud from './Cloud';

class CostCalcuate extends Component {
    constructor(){
        super();
        this.state ={
            cpu: '',
            ram: '',
            disk: '',
            router: '',
            switch: ''
        }
    }

    setReq(req){
        this.setState({
            cpu: req.cpu,
            ram: req.ram,
            disk: req.disk,
            router: req.router,
            switch: req.switch
        })
    }

    handelSubmit(event){
        // event
        event.preventDefault();
        this.props.setReq(this.state);
    }


    render(){
        return(
            <div>
                <p>cost calculate</p>
                <div>

                <DataCenter setReq={this.setReq.bind(this)}/>
                </div>
                <div>
                <Cloud/>
                </div>

                {/* <button>Make Req</button> */}
                <MakeRequest req={this.state}/>
            </div>
        )
    }
}
export default CostCalcuate;
